  render(){
    const {name,city,state}=this.props;
    return(
      <div>
        <p>Name:{name}</p>
        <p>City:{city}</p>
        <p>sate:{state}</p>

      </div>
    )
  }
}
export class App1 extends React.Component{
  render(){
    return(
      <div>
        <h3>Child Component</h3>
        <App name="Raghav" city="Banglore" state="karnataka" />
      </div>
    )
  }
}
